      <br />
      <select>
        {days_per_week.map((day, key) => (
          <option value={day + 1} key={key}>
            {day + 1}
          </option>
        ))}
      </select>
      <br />
      <p>how many years have you been training?</p>
      <select>
{years.map ((year,key) =>(
<option value={year +1} key={key}>
{year +1}
</option>

))}
      </select>
      <button onClick={() => setUser({ ...user, test: "test" })}>Next</button>
    </div>
  );
}
